delete from MSGIN
where MSGIN_TXDATE = #{msginTxdate,jdbcType=CHAR}
  and MSGIN_BRNO = #{msginBrno,jdbcType=CHAR}
  and MSGIN_FEPNO = #{msginFepno,jdbcType=CHAR}
